script: |
  super -f text -I q5665.spq | sort > q5665.out

inputs:
  - name: q5665.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - 2 * ( ( + col1 ) ) NOT IN ( - ( - + col0 ) + col2 + + 70 * - + col0 - - col1 + 48 * + - col1, + col2 + + 11, - - 21 * col1 - + - col2 );
  - name: tab1

outputs:
  - name: q5665.out
    data: |
      51	14	96
      85	5	59
      91	47	68
